import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/RamPage.css'; // Import the CSS file

const ramData = [
  { id: '67ff0d56173e97a1a082e4a8', name: 'G.Skill Trident Z5 Neo RGB', image: 'data:image/jpeg;base64,', slug: 'g-skill-trident-z5-neo-rgb' },
  { id: '67ff0d56173e97a1a082e4a9', name: 'Corsair Vengeance RGB DDR5', image: 'data:image/jpeg;base64,', slug: 'corsair-vengeance-rgb-ddr5' },
  { id: '67ff0d56173e97a1a082e4aa', name: 'Kingston FURY Beast RGB DDR5', image: 'data:image/jpeg;base64,', slug: 'kingston-fury-beast-rgb-ddr5' },
  { id: '67ff0d56173e97a1a082e4ab', name: 'TEAMGROUP T-Force Delta RGB DDR5', image: 'data:image/jpeg;base64,', slug: 'teamgroup-t-force-delta-rgb-ddr5' },
  { id: '67ff0d56173e97a1a082e4ac', name: 'Crucial Ballistix RGB DDR4', image: 'data:image/jpeg;base64,', slug: 'crucial-ballistix-rgb-ddr4' },

];

const RamPage = () => {
  return (
    <div className="ram-page">
      <h2>Browse RAM</h2>
      <div className="ram-grid">
        {ramData.map((ram) => (
          <Link to={`/product/${ram.id}`} key={ram.id} className="ram-card">
            <img src={ram.image} alt={ram.name} />
            <h3>{ram.name}</h3>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default RamPage;
